local function rainbowColor()
    local time = tick() * 0.5
    local r = (math.sin(time + 0) + 1) / 2
    local g = (math.sin(time + 2 * math.pi / 3) + 1) / 2
    local b = (math.sin(time + 4 * math.pi / 3) + 1) / 2
    return Color3.new(r, g, b)
end

